import React from 'react';
import FormComponentAnesthesia2 from '../..//FormComponentAnesthesia2';

const AnesthesiaSecondYear = () => {
  const studentInfo = {
    rollNumber: '145728-801894',
    name: 'STUDENT NAME',
    soName: 'PARENT NAME'
  };

  const subjectsData = [
    {
      paper: 'I',
      subject: 'Anatomy & Physiology',
      theorySecured: 80,
      result: 'Pass'
    },
    {
      paper: 'II',
      subject: 'Microbiology',
      internalSecured: 40,
      theorySecured: 80,
      practicalSecured: 120,
      result: 'Pass'
    },
    {
      paper: 'III',
      subject: 'Pathology',
      theorySecured: 80,
      result: 'Pass'
    }
  ];

  return (
    <FormComponentAnesthesia2
      title="Second Year B.Sc. Anesthesia Technology Marks Memo"
      studentInfo={studentInfo}
      subjectsData={subjectsData}
    />
  );
};

export default AnesthesiaSecondYear;
